// export default HeartDisplay;

const HeartDisplay = () => {
  const navigate = useNavigate();
  
  return (
    <div className="min-h-screen bg-rose-50 relative overflow-hidden
                    flex flex-col items-center justify-between
                    p-4 md:p-8">
      {/* Floating Hearts */}
      {Array(40).fill(null).map((_, i) => (
        <div
          key={i}
          className="absolute text-rose-500/60 animate-floatUp"
          style={{
            left: `${Math.random() * 100}%`,
            fontSize: `${Math.random() * 20 + 20}px`,
            animationDelay: `${Math.random() * 3}s`
          }}
        >
          ❤
        </div>
      ))}

      <div className="flex-1 flex items-center justify-center w-full">
        <div className="relative">
          <div className="text-red-500 text-[200px] sm:text-[400px] md:text-[600px] lg:text-[800px]
                        leading-none animate-heartbeat filter drop-shadow-lg">
            ❤
          </div>
          <div className="absolute top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2
                        text-white text-2xl md:text-4xl font-bold text-center
                        whitespace-nowrap shadow-sm">
            Your Name
          </div>
        </div>
      </div>

      <div className="w-full max-w-sm mt-8 z-10">
        <button
          onClick={() => navigate('/AnimatedLove')}
          className="w-full flex items-center justify-center gap-2
                    py-3 px-4 bg-rose-400 hover:bg-rose-500
                    text-white rounded-md transition-colors duration-300"
        >
          Last Page
          <ArrowLeft className="w-5 h-5" />
        </button>
      </div>

      <style>{`
        @keyframes heartbeat {
          0% { transform: scale(1); }
          50% { transform: scale(1.05); }
          100% { transform: scale(1); }
        }
        @keyframes floatUp {
          0% { transform: translateY(0) rotate(0deg); opacity: 1; }
          100% { transform: translateY(-800px) rotate(360deg); opacity: 0; }
        }
      `}</style>
    </div>
  );
};
